import React from 'react'
import { Button, Col } from 'react-bootstrap';

export default function User(props) {
  const { data } = props;
  return (
    <Col xs={{ span: 10, offset: 1 }} sm={{ span: 8, offset: 0 }} md={4} lg={4} >
      <div className='User'>
        <img src={data.picture} alt="No-image" width="100px" height="100px" />
        <div className='info'>
          <span > {data.firstName}</span>
          <Button variant='outline-primary'>Add friend</Button>
        </div>
      </div>
    </Col>
  )
}
